import 'intersection-observer';
import {InView} from 'react-intersection-observer';

import Scramble from '../components/Scramble';

export default function Index() {
  return (
    <InView>
      {({inView, ref, entry}) => (
        <div ref={ref}>
          {inView}
          <Scramble s="Hello, my name is Kevin" />
        </div>
      )}
    </InView>
  );
}
